import styled from 'styled-components';
import { font } from 'styles/fonts';

export default function TodoDetailContainer() {
  return (
    <Container>
      <Title></Title>
    </Container>
  );
}

const Container = styled.div`
  width: 60%;
  padding: 40px;
  overflow: hidden;
  background-color: red;
`;

const Title = styled.h1`
  ${font(24, 700, 30)}
  color: #c58940;
`;
